Cochrane Central Register of Controlled Trials (CENTRAL), MEDLINE, EMBASE will be searched. One Chinese database (CNKI) and five Korean database (Korean Association of Medical Journal Editors, Korean Medical Database, Korean studies Information Service System, National Digital Science Library, Korean Institute of Science and Technology Inforamtion) will be systematically searched from the inception to Feb 2020. 

To find relevant literature unabled to be searched through searching engines, reference of found papers will be screened. The WHO International Clinical Trials Registry Platform (ICTRP) will be searched to investigate unpublished trials. We will contact to the researchers get the information about the ongoing study.

Participants/population&gt;
This review will include participants who had anterior cruciate ligament reconstruction without restriction of their age, sex and type of grafts used in anterior cruciate ligament reconstruction. Onset and post-operation date is not considered for the inclusion criteria.

Intervention, exposure&gt;
All kinds of needling as long as it punctures skin, without any liquid injected or embedded over one hour or intended bloodletting, will be dealt with. Other stimulations to the needle such as electric or heat will be also included in this study. However only pressing down or rubbing the skin without needle penetration will be excluded.

Comparator/control&gt;
1. All kinds of post-operative rehabilitation program(this includes physical therapy, exercise, joint mobilization using a medical instruments such as continuous passive motion machine)
2. All kinds of oral analgesics

